<p data-start="387" data-end="480">‚ùóÔ∏è<strong data-start="389" data-end="426">O <code data-start="393" data-end="409">pdf-lib.min.js</code> deve vir antes</strong> de <code data-start="430" data-end="441">script.js</code>, sen√£o a vari√°vel <code data-start="460" data-end="468">PDFLib</code> n√£o existe.</p>
